#include<bits/stdc++.h>
using namespace std;
#define ll long long int
ll power(ll a, int b){
	ll res=1;
	while(b!=0){
		if(b%2==1) {
			res=res*a;
		}
		a=a*a;
		b=b/2;
	}
	return res;
}
